import React from 'react';
import {
  MDBCarousel,
  MDBCarouselItem,
} from 'mdb-react-ui-kit';
import Search from './Search';



export default function Home() {
  return (
    <div>
    <MDBCarousel showIndicators showControls fade>
      <MDBCarouselItem
        className='w-100d-block'
        itemId={1}
        src='https://www.rent.com/blog/wp-content/uploads/2021/04/rentalhouse_hero_david-veksler-VW5YwCYbPyk-unsplash.jpg'
        alt='...'
      >
      </MDBCarouselItem>

      <MDBCarouselItem
        className='w-100 d-block'
        itemId={2}
        src='https://image-cdn.carrot.com/uploads/sites/69435/2023/01/hd-wallpaper-g871b7a599_1920-1920x800.jpg'
        alt='...'
      >

      </MDBCarouselItem>

      <MDBCarouselItem
        className='w-100 d-block'
        itemId={3}
        src='https://media.architecturaldigest.com/photos/576d98445ea3e586576ec49a/16:9/w_2580,c_limit/luxury-vacation-rental-sites-03.jpg'
        alt='...'
      >

      </MDBCarouselItem>
    </MDBCarousel>
    <Search />
    </div>
  );
}
